package com.br.contactfetchapp.data.source.local.room.daoimport androidx.room.Daoimport androidx.room.Insertimport androidx.room.OnConflictStrategyimport androidx.room.Queryimport kotlinx.coroutines.flow.Flowimport com.br.contactfetchapp.data.source.local.room.entity.RandomUserEntity@Daointerface RandomUserDao {    @Insert(onConflict = OnConflictStrategy.REPLACE)    suspend fun insertUsers(randomUserEntity: List<RandomUserEntity>)    @Query("SELECT * FROM RandomUserEntity")    fun getAllUsers(): Flow<List<RandomUserEntity>>}